import React from 'react';
import { StyleSheet, View, Text } from 'react-native';

import * as Animatable from 'react-native-animatable'
import FontAwesome from 'react-native-vector-icons/FontAwesome';
import Feather from 'react-native-vector-icons/Feather';

export default class Home extends React.Component {

  state = {
    student_id: ''
  }


  componentDidMount(){

   }

   render() {
      

      return (
          <View style = {styles.view}>
            <View style = {styles.container}>
            <Animatable.View
                animation='bounceIn'
              >
                <Feather 
                  name="video"
                  color="#05375a"
                  size = {70}
                  style = {styles.tab}
                /> 
                <Text> Lessons</Text>
            </Animatable.View>

            <Animatable.View
                animation='bounceIn'
              >
                <Feather 
                  name="file-text"
                  color="#05375a"
                  size = {70}
                  style = {styles.tab}
                /> 
                <Text style = {styles.text}> Notes </Text>
            </Animatable.View>
            </View>
          </View>
        
    );
  }
}

var styles = StyleSheet.create({

  view: {
    backgroundColor: '#009387',
    height: '100%',
    alignItems: 'center',
    justifyContent: 'center',
  },
  container: {
    borderRadius: 20,
    height: '30%',
    width: '70%',
    maxWidth: 300,
    backgroundColor: "#fff",
    alignItems: 'center',
    justifyContent: 'center',
    display: 'flex',
    flexDirection: 'row',
    flexWrap: 'wrap',
  },
  tab: {
    margin: 15,
  },
  text: {
    alignItems: 'center',
  }
 });
